import { Button } from "antd";
import {
  SlidingDiv,
  UsersDiv,
  SocialShareHeading,
  SocialShareFacebook,
  AutopostDiv,
  MaxScoreDiv,
  PostPerdayDiv,
  PostGap,
} from "./Component";
import { useState } from "react";
import { CheckOutlined, CloseOutlined } from "@ant-design/icons";
import { Switch, Space } from "antd";
import { styled } from "styled-components";
import { Col, Slider,Collapse } from "antd";
import { Input, Drawer } from "antd";
const SocialDiv = () => {

    const items = [
        {
          key: '1',
          label: 'Facebook',
          children: <p>{text}</p>,
        }
    ]

  const [userData, setuserData] = useState([
    {
      name: "kuberan",
      autopost: false,
      score: 2,
      posts: 3,
      gaphours: 2,
      gapminutes: 13
    }
  ]);

  const InputGap = styled(Input)`
    width: 50px;
    height: 32px;
  `;
  const [inputValue, setInputValue] = useState(1);
  const onChange = (newValue) => {
    setInputValue(newValue);
  };

  const [isChecked, setIsChecked] = useState(userData[0].autopost);

  const handleSwitchChange = (checked) => {
    setIsChecked(checked);
  };

  const [Posts, setPosts] = useState(0);
  const HandlePostChange = (e) => {
    console.log(e.target.value)
    setPosts(e.target.value);
  };
  const [hours,sethours]=useState(0)
  const [minutes,setminutes]=useState(0)
  const handleHours=(e)=>{
    sethours(e.target.value)
  }
  const handleminutes=(e)=>{
    setminutes(e.target.value)
  }

  const HandleSubmit = () => {
    let ChangeData = {
      name: "kuberan",
      autopost: isChecked,
      score: inputValue,
      posts: Posts,
      gaphours: hours,
      gapminutes: minutes
    }
    setuserData([ChangeData]);
  };
  const [open, setOpen] = useState(false);
  const showDrawer = () => {
    setOpen(true);
  };
  const onClose = () => {
    setOpen(false);
  };

  const socialmedia = [
    {
      key: '1',
      label: 'This is panel header 1',
      children: text,
    },
    {
      key: '2',
      label: 'This is panel header 2',
      children: text,
    },
    {
      key: '3',
      label: 'This is panel header 3',
      children: text,
    },
  ];

  return (
    <UsersDiv>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Auto Post</th>
            <th>Min Score to post</th>
            <th>Post per day</th>
            <th>Gap between posts</th>
            <th>Settings</th>
          </tr>
        </thead>
        <tbody>
          {userData.map((item) => (
            <tr>
              <td>{item.name}</td>
              <td>{item.autopost.toString()}</td>
              <td>{item.score}</td>
              <td>{item.posts}</td>
              <td>{item.gaphours} Hours {item.gapminutes} minutes</td>
              <td><Button type="primary" onClick={showDrawer}>Settings</Button></td>
            </tr>
          ))}  
        </tbody>
      </table>

        <Drawer title="Social Share Setting" width={520} placement="right" onClose={onClose} open={open}>

        <Collapse items={items} defaultActiveKey={['1']} onChange={onChange} />;

        <div>
            <Button type="primary" onClick={HandleSubmit}>
              Update
            </Button>
          </div>
        </Drawer>

    </UsersDiv>
  );
};

export default SocialDiv;
